import React,{useState} from "react";
import Tweet from "./tweet";
const TweetList = () =>{
    const [tweets , setTweet] = useState([
        {
            title : 'halo',
            content : 'Tweet!',
            likes : 2,
            id : 0
        },
        {
            title : '2nd tweets!',
            content : 'gwad damn',
            likes : 6,
            id : 1
        },
        {
            title : 'unwell',
            content : 'might',
            likes : 9,
            id : 2
        }
    ]);
    return(
        <div>
        {tweets.map(tweet => (
            <Tweet title={Tweet.title} content={tweet.content} likes={tweet.likes} key={tweet.id} />
        ))}
        </div>
    )
}
export default TweetList
